import React from 'react';
import { Container, Row, Col } from 'reactstrap';

function Header() {
    return (
        <div className="bt-header">
            <Container>
                abc
                <Row className="h-36">
                    <Col sm='6'>abc</Col>
                    <Col sm='6'></Col>
                </Row>
            </Container>
        </div>
    )
}

export default Header
